const MovieComp = ({movie}) => {
  return (
    <div style={{ border: '3px solid green', width: '300px' }}>
        <h4>{movie.name}</h4>
        Genres: {movie.genres.map(name=> `${name}` ? `"${name}" ` : ',')}
    </div>
  )
}

export default MovieComp
